function Privacy() {
  return (
    <div className="wrapper">
      <div className="header">
        <h2>Privacy Policy</h2>
      </div>
      <div className="section"></div>
    </div>
  );
}

Privacy.Layout = DashboardLayout;

export default Privacy;
